tables.table_schema:
CREATE TABLE land_use_patterns (
    area_id UUID PRIMARY KEY,
    area_name VARCHAR(255),
    land_type VARCHAR(100),
    green_space_available BOOLEAN
);

CREATE TABLE green_space_expansion (
    expansion_id UUID PRIMARY KEY,
    area_id UUID REFERENCES land_use_patterns(area_id),
    expansion_date DATE,
    expansion_area DECIMAL
);

CREATE TABLE LandUsePatterns (
    id INT PRIMARY KEY,
    area_name VARCHAR(50),
    land_type VARCHAR(50),
    percentage_covered DECIMAL
);

CREATE TABLE GreenSpaceExpansion (
    id INT PRIMARY KEY,
    area_name VARCHAR(50),
    planned_expansion_area DECIMAL,
    expansion_date DATE
);

CREATE TABLE LandUseHistory (
    id INT PRIMARY KEY,
    area_name VARCHAR(50),
    year INT,
    land_use_category VARCHAR(50)
);
